import React from 'react';
import '../styles/Navbar.css';
import { Link } from 'react-router-dom';

export default function Navbar() {
  return (
    <div className="navbar">
      <div className="navbar-container">
        <div className="logo-container">
          <h1 className="logo">EARL'S</h1>
        </div>
        <div className="menu-container item1">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0 d-flex justify-content-center">
            <li className="nav-item">
              <Link className="nav-link active text2" aria-current="page" to="/">
                MOVIES
              </Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link text2" to="/updatemovies">
                FAVOURITE
              </Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link text2" to="/newmovies">
                UPDATE
              </Link>
            </li>
          </ul>
        </div>
        <div className="profile-container">
          <img className="profile-picture" src="images/me1.jpeg" alt="profile-pic" />
          <div className="profile-container-text">
            <span className="profile-text">Profile</span>
            <i className="fa-solid fa-caret-down"></i>
          </div>
        </div>
      </div>
    </div>
  );
}



